import Video from '../Video';

import './style.css';

const Galeria = () => {
  return(
    <section id="galeria">
      <div className="grid">
        <img src="https://img.r7.com/images/2014/05/12/knvo17l5v_5akv3vxpc4_file.jpg?dimensions=702x431"></img>
      </div>
    </section>
  )
}

export default Galeria;
